	('288aaf3b-2fd3-40bc-9954-30ee613a34d4', 'Spoleto', 'Italy', 65, 'mediterranean', 8, 9, 'Spoleto is a charming town in the Umbria region of Italy, known for its mild Mediterranean climate, rich cultural heritage, and picturesque landscapes. Retirees can enjoy a relaxed lifestyle, with a relatively low cost of living compared to other parts of Italy. The town''s main attractions include the historic Spoleto Cathedral, the Rocca Albornoziana fortress, and the annual Spoleto Festival, a renowned arts and music event.', 2250, 38000, 9, 2, 3, 'Spoleto Cathedral', 'Rocca Albornoziana', 'Ponte delle Torri', 'https://www.google.com/maps/place/Spoleto+Italy', 'https://axlruvvsjepsulcbqlho.supabase.co/storage/v1/object/public/town-images/it-spoleto-s2r-image-1920x1080px-S.jpg', NULL, NULL, 'Continental climate with warm summers (27°C) and cool winters (6°C). Beautiful seasons.', 28, 8, 730, 2460, 'Rentals run manageable, dining out premium costs. Grocery bills typical, monthly utilities fair.', 760, 30, 260, 100, 'Good healthcare infrastructure with a hospital within reach. Local language helpful for medical visits. Basic specialties covered, may need to travel for complex care.', 1, 300, false, 'Offers good hiking and nature access alongside modest cultural scene. Unhurried atmosphere with adequate dining choices and essential stores. Quiet social scene year-round.', 4, 4, 9, 'Strong safety record with effective local governance. Local emergency facilities available with occasional weather events possible. Mountain terrain affects emergency response times. Outdoor dining relaxed, comfortable for solo female residents.', 'very low - one of the safest destinations', 3, 'Excellent fiber connectivity supporting remote work, good public transport coverage for daily mobility. Simple infrastructure with adequate essential services. Limited banking facilities, some pedestrian zones.', 100, 6, 'Perugia San Francesco d''Assisi Airport (PEG)', '126', 7, '2025-08-23 01:13:42.897+00', '