	('69a185b6-c8cf-47f3-8985-3826715ce3d4', 'Authentic Spanish living?', 'Orange groves surround traditional pueblos where plaza life defines the daily rhythm. Extended family lunches, afternoon siestas, and evening strolls create a lifestyle focused on community and connection.', 'Spain', 'country', 'https://axlruvvsjepsulcbqlho.supabase.co/storage/v1/object/public/daily-inspirations//es-marbella-depositphotos_521674956_L.jpg', 'unsplash', 'Photo of Valencia, Spain', '{Coastal,Plains,Mountains}', '{Mediterranean,Subtropical}', '{hot}', '{cool}', 'Dry', 'Often Sunny', 'Mostly Dry', '{urban,suburban,rural}', 'Moderate', 'Social', 'large', 'willing_to_learn', 'Spanish', 'moderate', 'good', 7, 'good', 85, 'good', 90, 'moderate', '[2000,4001)', '[600,1501)', '{walk_bike,public_transit}', '{train_access,bus_network}', 'major_airport', 'EUR', 'CET', '{4,5,9,10,11}', 150, '{spain,mediterranean,culture,siesta,tapas,community}', '{"EU healthcare system","Vibrant culture","Excellent infrastructure","Mediterranean climate"}', '{Valencia,Malaga,Seville,Barcelona,Madrid}', 2, true, '{"summer": "Very hot in inland areas", "winter": "Mild but can be cool in northern regions"}', 45, 3.20, 92.00, 85.00, NULL, 0, 0, '2025-06-29 22:44:44.493152+00', '2025-06-29 22:44:44.493152+00'),
	('39dda66f-6a24-4cab-8165-4907e35e4b60', 'Swiss alpine villages?', 'Pristine mountain towns where trains run on time and hiking trails start at your doorstep. World-class healthcare, stunning scenery, and a culture that values quality of life above all else.', 'Switzerland', 'country', 'https://images.unsplash.com/photo-1530122037265-a5f1f91d3b99?w=800&q=80', 'unsplash', 'Photo of Swiss Alps', '{Mountains,Valley,Lakes}', '{Forest}', '{mild}', '{cold}', 'Dry', 'Balanced', 'Balanced', '{rural,suburban}', 'Moderate', 'Balanced', 'small', 'comfortable', 'German/French/Italian', 'high', 'good', 7, 'good', 90, 'basic', 90, 'premium', '[5000,8001)', '[2000,4001)', '{public_transit,walk_bike}', '{train_access,bus_network}', 'major_airport', 'CHF', 'CET', '{6,7,8,9}', 250, '{switzerland,alps,quality,healthcare,nature,expensive}', '{"Highest quality of life","Pristine nature","Excellent healthcare","Safe and orderly"}', '{Zurich,Geneva,Lucerne,Interlaken,Zermatt}', 17, true, '{"cost": "Extremely high cost of living", "visa": "Difficult residency requirements"}', 6, 6.50, 98.00, 90.00, NULL, 0, 0, '2025-06-29 22:44:44.493152+00', '2025-06-29 22:44:44.493152+00'),
	('4f26c5a7-a659-4eec-8cfe-1dc52f66d61b', 'Italian dolce vita?', 'Rolling hills dotted with cypress trees lead to medieval towns where life unfolds at a perfect pace. Local trattorias serve regional specialties while sunset turns vineyard-covered valleys golden.', 'Italy', 'country', 'https://axlruvvsjepsulcbqlho.supabase.co/storage/v1/object/public/daily-inspirations//it-tuscany-local%20produce-Depositphotos_166334270_XL.jpg', 'unsplash', 'Photo of Lucca, Italy', '{Mountains,Valley,Coastal}', '{Mediterranean,Subtropical}', '{hot}', '{cool,mild}', 'Balanced', 'Often Sunny', 'Balanced', '{urban,suburban,rural}', 'Slow', 'Social', 'moderate', 'willing_to_learn', 'Italian', 'low', 'good', 2, 'good', 75, 'functional', 90, 'moderate', '[2000,4001)', '[600,1501)', '{walk_bike,need_car}', '{train_access,bus_network}', 'regional_airport', 'EUR', 'CET', '{4,5,9,10}', 80, '{italy,tuscany,culture,food,wine,history}', '{"Rich culture","Amazing food","Beautiful landscapes","Relaxed lifestyle"}', '{Florence,Lucca,Siena,Bologna,Verona}', 4, true, '{"summer": "Can be very hot and crowded", "winter": "Many rural businesses reduce hours"}', 35, 3.50, 88.00, 75.00, NULL, 0, 0, '2025-06-29 22:36:31.302569+00', '2025-06-29 22:36:31.302569+00'),
	('27a7b088-b3a4-4c40-bc99-15518660fe87', 'Panama mountain escape?', 'Cool mountain towns offer spring-like weather year-round with stunning valley views. Coffee plantations, hiking trails, and a thriving expat community create an ideal retirement haven.', 'Panama', 'country', 'https://upload.wikimedia.org/wikipedia/commons/5/58/Aerial_view_of_the_Province_of_Chiriqui%2C_Republic_of_Panama_14.jpg', 'unsplash', 'Photo of Boquete, Panama', '{Mountains,Valley,Forest}', '{Forest,Subtropical}', '{mild}', '{mild}', 'Humid', 'Balanced', 'Often Rainy', '{rural,suburban}', 'Slow', 'Social', 'large', 'english_only', 'Spanish', 'high', 'good', 61, 'good', 72, 'good', 180, 'budget', '[1500,3001)', '[500,1201)', '{walk_bike,need_car}', '{bus_network}', 'regional_airport', 'PAB', 'EST', '{12,1,2,3,4}', 45, '{panama,mountains,coffee,expats,cool_climate,affordable}', '{"Pensionado visa program","Uses US dollar","Large expat community","Spring-like climate"}', '{Boquete,David,"El Valle",Volcan,"Panama City"}', 9, true, '{"summer": "Rainy season - can be very wet", "winter": "Dry season - perfect weather"}', 8, 2.50, 78.00, 72.00, NULL, 0, 0, '2025-06-29 22:44:44.493152+00', '2025-06-29 22:44:44.493152+00');
