INSERT INTO "public"."retirement_tips" ("id", "title", "content", "category", "created_at", "updated_at") VALUES
	(1, 'Start budgeting in your future currency', 'Begin tracking expenses in the currency of your target country at least a year before moving. This helps you understand real costs and adjust to different price structures.', 'financial', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(2, 'Consider tax treaty implications', 'Research tax treaties between your home country and retirement destination. Some countries offer significant tax advantages for retirees that could save thousands annually.', 'financial', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(3, 'Open a multi-currency account early', 'Set up international banking solutions before you move. This allows you to take advantage of favorable exchange rates and avoid costly transfer fees later.', 'financial', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(4, 'Factor in hidden relocation costs', 'Budget for visa fees, shipping, temporary accommodation, and setting up utilities. These one-time costs often exceed initial estimates by 30-50%.', 'financial', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(5, 'Understand pension portability', 'Verify how your pension or retirement benefits transfer internationally. Some countries have agreements that prevent double taxation on retirement income.', 'financial', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(6, 'Research healthcare reciprocity agreements', 'Many countries have healthcare agreements allowing access to public systems. Understanding these can save significant money on private insurance.', 'healthcare', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(7, 'Get comprehensive health records', 'Compile complete medical records, vaccination history, and prescription details. Having these translated can expedite healthcare enrollment abroad.', 'healthcare', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(8, 'Investigate medical tourism benefits', 'Your retirement destination might offer affordable procedures that are expensive at home. Research quality healthcare facilities and potential savings.', 'healthcare', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(9, 'Plan for prescription medications', 'Verify availability and regulations for your medications in the target country. Some require local prescriptions or may have different names.', 'healthcare', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(10, 'Consider long-term care options', 'Research assisted living and home care services in your chosen location. Costs and quality can vary dramatically between countries.', 'healthcare', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(11, 'Start the visa process early', 'Retirement visa requirements change frequently. Begin gathering documents 12-18 months before your planned move to avoid delays.', 'legal', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(12, 'Understand property ownership laws', 'Some countries restrict foreign property ownership. Research whether you can buy, need a local partner, or should consider long-term rentals.', 'legal', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(13, 'Set up power of attorney', 'Designate someone in your home country to handle affairs you cannot manage remotely. This is crucial for property, taxes, and emergencies.', 'legal', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(14, 'Learn about inheritance laws', 'International inheritance can be complex. Understand how local laws might override your will and plan accordingly with legal counsel.', 'legal', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(15, 'Register with your embassy', 'Once relocated, register with your home country''s embassy or consulate. This ensures you receive important updates and emergency assistance.', 'legal', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(16, 'Visit during different seasons', 'Experience your chosen destination in various seasons before committing. Weather, tourist crowds, and local life can vary dramatically throughout the year.', 'lifestyle', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(17, 'Learn basic local language', 'Start language learning at least a year before moving. Even basic conversational skills greatly improve daily life and integration.', 'lifestyle', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(18, 'Connect with expat communities early', 'Join online forums and social media groups for expats in your target location. Their experiences provide invaluable practical insights.', 'lifestyle', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(19, 'Research transportation options', 'Understand public transport, driving requirements, and walkability. Some retirees find they no longer need a car, while others discover one is essential.', 'lifestyle', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(20, 'Plan for staying connected', 'Research internet reliability, phone plans, and how to maintain contact with family. Good connectivity is crucial for modern retirement.', 'lifestyle', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(21, 'Join local clubs before moving', 'Many areas have clubs that accept international members. Joining remotely helps you build connections before arrival.', 'social', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(22, 'Understand social customs', 'Research local etiquette, gift-giving customs, and social norms. This knowledge helps avoid misunderstandings and speeds integration.', 'social', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(23, 'Plan regular home visits', 'Budget for trips back home, especially in the first years. Maintaining connections helps combat homesickness and culture shock.', 'social', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(24, 'Explore volunteer opportunities', 'Volunteering provides purpose, social connections, and cultural immersion. Research organizations that welcome international retirees.', 'social', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(25, 'Consider co-living arrangements', 'Some retirees find shared housing with other expats eases the transition. Research retirement communities catering to international residents.', 'social', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(26, 'Create a phased relocation plan', 'Consider renting before buying and keeping some assets in your home country initially. This provides flexibility if plans change.', 'practical', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(27, 'Document everything digitally', 'Scan important documents and store them securely online. Physical documents can be lost, but digital copies are always accessible.', 'practical', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(28, 'Research import regulations', 'Understand what you can bring, duties on household goods, and restrictions on items like medications or electronics.', 'practical', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(29, 'Test your retirement budget', 'Try living on your projected retirement budget for 6 months before moving. This reveals if your financial planning is realistic.', 'practical', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00'),
	(30, 'Build an emergency fund', 'Maintain an emergency fund covering 12 months of expenses. International moves often involve unexpected costs and delays.', 'practical', '2025-06-28 21:43:46.854309+00', '2025-06-28 21:43:46.854309+00');
